import React from 'react';
import { GlobalStyle, WeatherCard, miInfo, BreakLine } from '../../styles/styles';
import { findLanguageByKey } from '../../languages/Languages';
import { useLocation } from 'react-router-dom';
const SocialNetwork = () => {
	const { state } = useLocation();
	const { actualLanguage } = state;
	console.log(actualLanguage);
	const fullLanguage = findLanguageByKey(actualLanguage);
	return (
		<>
			<GlobalStyle />
			<WeatherCard>
				<miInfo>{fullLanguage.socialNetworks.myInfo}</miInfo>
			</WeatherCard>
		</>
	);
};

export default SocialNetwork;
